import React from 'react'
import styled from 'styled-components'

const HeaderJR = () => {
    return (
        <>
            <HeaderMain>
                <div className="header-jr">
                    <h1>Landlines</h1>
                    <h2>M12 Studio</h2>
                </div>
            </HeaderMain>
        </>
    )
}

export default HeaderJR

const HeaderMain = styled.div`
    position: absolute;
    top: .5rem;
    left: 50%;
    transform: translateX(-50%);
    text-transform: uppercase;
    line-height: 1;
    color: #fff;
    transition: all .6187s;
    pointer-events: none;
    width: 100%;
    z-index: 200;

    /* margin-left: 200px; */

    display: flex;
    justify-content: center;

    h1{
        display: inline-block;
        font-size: 1rem;
        letter-spacing: 1px;
        text-shadow: 0 0 15px rgba(0,0,0,1);
    }

    h2{
        display: inline-block;
        font-size: 1rem;
        font-weight: 400;
        text-shadow: 0 0 15px rgba(0,0,0, 1);
        margin-left: 1rem;

    }

    .open{
        transform: translateX(240px);
    }
`
